script: |
  super -f text -I q7386.spq | sort > q7386.out

inputs:
  - name: q7386.spq
    data: |
      SELECT DISTINCT - col2 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE NULL NOT BETWEEN col1 AND - 49 - CAST ( NULL AS INTEGER ) * - + CAST ( NULL AS INTEGER ) * - - col1;
  - name: tab1

outputs:
  - name: q7386.out
    data: |
